text:
దయచేసి సహాయం చేయండి;ఆర్థోరెక్సియా, ఆరోగ్య ఆందోళన, శాకాహారం మరియు ఇంటర్నెట్ క్వాక్స్ హాయ్,

&amp;#x200B;

నేను ఆరోగ్య ఆందోళన మరియు ఆర్థోరెక్సియాను అనుభవిస్తున్నాను, నేను ఆహారంతో నిజంగా అనారోగ్యకరమైన సంబంధాన్ని కలిగి ఉన్నాను మరియు నా ఆరోగ్య ఆందోళన ఆహారం చుట్టూ ఎక్కువగా తిరుగుతుంది.అయినప్పటికీ, నేను పరీక్షలకు మరియు వైద్యులను చూడడానికి చాలా డబ్బు ఖర్చు చేశాను మరియు నా తెలివితేటలు ఉన్నాను.చట్టబద్ధమైన NHS డాక్టర్, గ్యాస్ట్రోఎంటరాలజిస్ట్ మరియు స్పెషలిస్ట్ ద్వారా నేను చేసిన ప్రతి ఆరోగ్య పరీక్ష గురించి నేను ఒత్తిడి చేయాల్సిన అవసరం లేదని నాకు చెప్పబడింది.నేను హానికరమైన రక్తహీనత కోసం రక్త పరీక్ష, ప్రతిదానికీ పూర్తి రక్త గణన పరీక్ష, గ్యాస్ట్రోఎంటరాలజిస్ట్ ద్వారా మల పరీక్ష.ఇప్పుడు నా ఆందోళన ఏమిటంటే, నాకు SIBO లేదా కొన్ని విచిత్రమైన గట్ వ్యాధి ఉంది.నేను కూడా శాకాహారినే.అయినప్పటికీ, నకిలీ లేదా బుల్‌షిట్ ఆరోగ్య పరీక్షలను విక్రయించాలనుకునే ఇంటర్నెట్ క్వాక్‌లచే నన్ను తప్పుదారి పట్టిస్తున్నారని నేను భయపడుతున్నాను, కొన్ని వారాల క్రితం నేను ఆర్గానిక్ యాసిడ్‌ల పరీక్షను కొనుగోలు చేసి, తీసుకున్నాను మరియు దాని ధర £ 256, మరియు పరీక్షను విక్రయించే ఆన్‌లైన్ న్యూట్రిషన్ కోచ్ నేను SIBO పరీక్షను తీసుకోవాలని సిఫార్సు చేసాడు, కనుక నా ఆరోగ్యం బాగా ఉందో లేదో తెలుసుకోవచ్చు.ఆందోళన మరియు ఆర్థోరెక్సియా.నేను పాదరసం ముక్కోణపు పరీక్ష కోసం £300 ఖర్చు చేసాను ఎందుకంటే పూరకాల నుండి పాదరసం విషపూరితం అయ్యిందని నేను భయపడి ఉన్నాను - ఇది అవాస్తవమని మరియు ఆరోగ్యానికి సంబంధించిన చాలా సాధారణ కేసుగా నేను ఇప్పుడు గుర్తించాను.నేను 'వియోమ్' కోసం £200 ఖర్చు చేశాను, అక్కడ మీరు స్టూల్ శాంపిల్‌ను పంపారు మరియు అది పూర్తిగా బోగస్.ఏమి చేయాలో నాకు తెలియదు, నేను SIBO యొక్క నిజమైన లక్షణాలు ఏవీ కలిగి లేనప్పటికీ, నా ఆందోళన నా ప్రేగు ఆరోగ్యంతో ముడిపడి ఉందనే ఆలోచనతో నేను నిమగ్నమై ఉన్నాను.నేను నా ఆరోగ్యం మరియు నేను తినే ఆహారం పట్ల నిమగ్నమై ఉన్నాను.నేను 5"6 వద్ద 21 ఏళ్ల మగవాడిగా 49-51 కిలోల బరువుతో రాయిని కోల్పోయే స్థాయికి చేరుకున్నాను.

&amp;#x200B;

ఎవరైనా దీనితో సంబంధం కలిగి ఉంటే దయచేసి సంకోచించకండి లేదా కొన్ని సలహాలు ఇవ్వండి.

&amp;#x200B;

ధన్యవాదాలు :)

లింఫోమా వంటి లక్షణాలతో 23 ఏళ్ల పురుషుడు అందరికీ హాయ్!

&amp;#x200B;

నేను కొన్ని నెలలు ఆసక్తికరంగా గడిపాను మరియు నా కథనాన్ని అందరితో పంచుకోవాలనుకుంటున్నాను!నేను ఏప్రిల్ నెలాఖరు వరకు ఇంటర్నల్ మెడిసిన్ డాక్టర్‌ని చూడలేను కాబట్టి కొంత ఫీడ్‌బ్యాక్ ఇవ్వాలనుకుంటున్నాను.. ఇదిగో!

&amp;#x200B;

నేపథ్య సమాచారం:

మే 2017లో, నాకు ఒక సంవత్సరం పాటు మంచి EBV ఇన్ఫెక్షన్ వచ్చింది.అదనంగా, నాకు తలసేమియా మైనర్ ఉంది, ఇది నన్ను ఎప్పుడూ ప్రభావితం చేయలేదని నేను నమ్ముతున్నాను మరియు నా డస్ట్ అలెర్జీల వల్ల ఎక్కువగా వచ్చే ఆస్తమా.

&amp;#x200B;

ప్రస్తుత సమస్యలు:

ఈ సంవత్సరం ఫిబ్రవరిలో, నా బుగ్గలు యాదృచ్ఛికంగా వాపును ప్రారంభించాయి, ఇది నాకు ఇంతకు ముందెన్నడూ జరగలేదు.నేను దాని గురించి పెద్దగా ఆలోచించలేదు, కానీ వారందరూ ఉబ్బిన తర్వాత నేను వైద్యుడిని సందర్శించాను.చలిగాలుల వల్ల అయి ఉంటుందని చెప్పి నన్ను పంపించేశాడు.

దాదాపు ఒక వారం తర్వాత నేను ఒక దుష్ట ఊపిరితిత్తుల ఇన్ఫెక్షన్‌ను అభివృద్ధి చేసాను, దాని వలన నా శోషరస కణుపులు పిచ్చిగా ఉబ్బాయి మరియు కొన్ని రోజుల వరకు చాలా తేలికపాటి గొంతు నొప్పి.నేను యాంటీబయాటిక్స్ తీసుకున్నాను మరియు లక్షణాలు మాయమయ్యాయి.

దాదాపు ఒక వారం తర్వాత, నాకు ఫుడ్ పాయిజనింగ్ వచ్చింది, అది రెండు రోజుల తర్వాత తగ్గిపోయింది.

&amp;#x200B;

అయితే ఫుడ్ పాయిజనింగ్ తర్వాత, కొన్ని ప్రారంభ లక్షణాలు తిరిగి వచ్చాయి.నా బుగ్గలు ఉబ్బుతూనే ఉన్నాయి మరియు నా శోషరస కణుపులు (నా మెడపై) చాలా చురుకుగా ఉన్నాయి.నేను వైద్యుడి వద్దకు వెళ్లాను, ఊపిరితిత్తుల వాపు వల్ల వచ్చిందని అతను భావించినందున అతను నాకు కొంత వెంటిలిన్ మరియు మరొక ఇన్హేలర్ ఇచ్చాడు.

&amp;#x200B;

రెండు వారాల తర్వాత నేను అలసటను అభివృద్ధి చేయడం ప్రారంభించాను, నేను 10 గంటలు నిద్రపోయాను మరియు నేను పడుకోనట్లు భావించాను.ఆ తర్వాత ప్రతిరోజూ రాత్రి భోజన సమయానికి నాకు కడుపు నొప్పిగా అనిపించేది, చాలా తేలికగా అనిపించింది, నాకు అర్థం కాలేదు కానీ నేను ఒత్తిడికి లోనయ్యాను అని అనుకున్నాను.

&amp;#x200B;

నాకు సహజంగానే మరొక ఊపిరితిత్తుల ఇన్ఫెక్షన్ వచ్చింది, కానీ దీని తర్వాత, ముఖ వాపు మరియు శోషరస కణుపు చర్య గతంలో కంటే కష్టంగా తిరిగి వచ్చింది.నేను రాత్రి సమయంలో నా దేవాలయాలపై తిమ్మిరిని కూడా అభివృద్ధి చేయడం ప్రారంభించాను మరియు నా వెంట్రుకలపై దాదాపు వేగంగా జుట్టు రాలడాన్ని గమనిస్తున్నాను (ఇంతకు ముందు బట్టతల ఎలాంటి సంకేతాలు లేవు).ఇది ఇప్పుడు గత కొన్ని రోజులుగా మిగిలిపోయింది..

&amp;#x200B;

ఇది సమస్యాత్మకమని నాకు తెలిసినందున నేను నిన్న ERకి వెళ్లాను.రక్తపరీక్షలలో ఆందోళనకరమైనది ఏమీ కనుగొనలేకపోయామని, అయితే నా ప్లీహము పెద్దదైందని గమనించామని, అల్ట్రాసౌండ్ పరీక్ష చేస్తామని వారు చెప్పారు.ఐరన్ టెస్ట్ మరియు మల విశ్లేషణ ఫలితాలు వచ్చే వారం వరకు తిరిగి రావు.

&amp;#x200B;

నేను నిజాయితీగా ఉంటాను, నా జీవితమంతా ఆరోగ్య సమస్యలు ఉన్నాయి, నేను నిజంగా భయపడటం నా జీవితంలో ఇదే మొదటిసారి.మీరు చేసినట్లుగా నేను లక్షణాలను గూగుల్ చేసాను.. మరియు నిజంగా కథకు బాగా సరిపోయేది లింఫోమా..

&amp;#x200B;

ప్రజలు ఏమనుకుంటున్నారో వినడానికి నేను ఆసక్తిగా ఉన్నాను.

&amp;#x200B;

చదివినందుకు ధన్యవాదాలు!

మీరు ఆరోగ్య ఆందోళనను ఎలా అధిగమించగలరు?హాయ్, నేను (21F) కొన్ని దీర్ఘకాలిక అనారోగ్యాలతో (టైప్ 1 డయాబెటిస్, హైపోథైరాయిడిజం మరియు స్కోలియోసిస్) పెరిగాను.నేను నా జీవితాంతం "హైపోకాండ్రియాక్"గా ఉన్నాను.సంభావ్య మధుమేహం సమస్యల నుండి (గత సంవత్సరం ఉద్భవించిన ఫ్లోటర్‌లు నేను ప్రతిరోజూ అంధుడిని అవుతున్నానని భావించేలా చేశాయి, 3 వేర్వేరు నేత్ర వైద్యులతో అపాయింట్‌మెంట్‌లు ఉన్నప్పటికీ నేను క్షేమంగా ఉన్నానని అందరూ చెప్పారు) నాకు HIV (నాకు లేదు) ఉందని భావించడం వరకు లైమ్స్ డిసీజ్ వరకు, నేను ఎప్పుడూ భయపడతాను.ముఖ్యంగా నా కళ్ల గురించి.నా రోజువారీ జీవితంలో కొనసాగడం కష్టం మరియు నా చికిత్సకుడు పెద్దగా సహాయం చేయడు.

&amp;#x200B;

కాబట్టి ఆరోగ్య ఆందోళనను ఎలా అధిగమించవచ్చు?
